  return (
    <div className="home-page">
      {/* <img src={cowImage} alt="Company Logo" className="logo-image" /> */}
      {/* TODO: Uncomment and update path for cow.jpg */}
      <img src="/placeholder_cow.jpg" alt="Company Logo - Placeholder" className="logo-image" style={{ maxWidth: '200px', display: 'block', margin: '20px auto' }}/>

      <h1>Welcome to On the Table!</h1>
      <p>
        Discover the freshest local produce and goods directly from farms near you.
        Our platform connects you with farmers in your community, bringing the farm
